import '../stylesheets/App.scss';


class CharacterNotExist extends React.Component {
  render() {
    return (

        <textarea name="textarea" rows="10" cols="50" value={this.props.value}> No hay ningun personale que coincida con </textarea>

    );
  }
}

export default CharacterNotExist;
